    def test_redirect_default_branch(self):
        '''
        '''
        with HTTMock(self.response_content):
            blog1 = self.client.get('/mapzen/blog')
            self.assertIn(blog1.status_code, (301, 302))

            redirect1 = urlparse(blog1.headers['Location'])
            self.assertEqual(redirect1.path, '/mapzen/blog/master/')

            blog2 = self.client.get('/mapzen/blog/')
            self.assertIn(blog2.status_code, (301, 302))

            redirect2 = urlparse(blog2.headers['Location'])
            self.assertEqual(redirect2.path, '/mapzen/blog/master/')
    
